import React from "react";

function LeftSideMenu() {
  return (
    <aside>
      <ul>
      <li className="side-li">HOME</li>
        <a href="https://drive.google.com/file/d/1MCr3txbDINfaXeZfXH8qi9ePbQpifYHa/view"><li className="side-li">SETTINGS</li></a>
        <a href="https://drive.google.com/file/d/1MCr3txbDINfaXeZfXH8qi9ePbQpifYHa/view"><li className="side-li">CONTACT US</li></a>
      </ul>
    </aside>
  );
}

export default LeftSideMenu;
